import React from 'react'

const App = () => {
  return (
    <div>
    <h1>Howdy</h1>
    </div>
  )
}

function Apps(){
return(
<>
<h1>Namsakram!</h1>
</>
)
}

const Appz = () => {
return(
<>
<h1>Sukriya</h1>
</>
)

}
export default App
export {Apps, Appz}
export const value = "Jio";
